import React from "react";
import  ReactDOM  from "react-dom";

const time = new Date();


ReactDOM.render(
  <>
  {time.toLocaleDateString}
  {time.toLocaleString}
  {time.toLocaleTimeString}
  </> , document.getElementById('root')
);
